define('text!nav/nav-bar.html', ['module'], function(module) { module.exports = "<template bindable=\"router, entered\">\n    <div class=\"navbar-fixed\">\n        <md-navbar>\n            <div class=\"media--links--mobile\">\n                <a href=\"https://github.com/bmb0205\" target=\"_blank\">\n                    <img class=\"github\" src=\"../../images/github.png\">\n                </a>\n                <a href=\"https://www.linkedin.com/in/brandon-burciaga-1b449067\" target=\"__blank\">\n                    <img class=\"linkedin\" src=\"../../images/linked-in.png\">\n                </a>\n            </div>\n            <a href=\"#/home\" class=\"brand-logo\" id=\"logo\"><span>BRANDON BURCIAGA</span></a>\n            <i md-sidenav-collapse=\"ref.bind: sideNavRight;\" class=\"material-icons mobile-menu\" md-waves>menu</i>\n            <ul class=\"hide-on-med-and-down right nav--item--color--change\">\n                <li md-waves repeat.for=\"row of router.navigation\" class=\"navbar--list--item ${row.isActive ? 'active' : ''}\">\n                    <a href.bind=\"row.href\">${row.title}</a>\n                </li>\n            </ul>\n        </md-navbar>\n    </div>\n    <md-sidenav view-model.ref=\"sideNavRight\" md-edge=\"right\">\n        <ul class=\"right nav--item--color--change\">\n            <li md-waves repeat.for=\"row of router.navigation\" class=\"navbar--list--item ${row.isActive ? 'active' : ''}\">\n                <a href.bind=\"row.href\">${row.title}</a>\n            </li>\n        </ul>\n    </md-sidenav>\n</template>"; });
define('text!pages/about/about.html', ['module'], function(module) { module.exports = "<template>\n    <div class=\"home\">\n        <div class=\"home--content-container\">\n            <div class=\"home--home-content\">\n                <h1>About</h1>\n                <hr class=\"content-divider\">\n                <p class=\"home--headline\"><i>\"I'm the greatest because I said so\" ~ Me</i></p>\n                <hr class=\"content-divider\">\n                <p class=\"home--home-paragraph\" id=\"paragraph--start\">\n                    For reasons best kept within a college application essay, I had dreamed of becoming a doctor since I was a boy. After\n                    obtaining a B.S. in Biochemistry from Virginia Tech, I chose a similar but different path and spent two\n                    years getting an M.S. in <a class=\"link--binf\" href=\"https://en.wikipedia.org/wiki/Bioinformatics\"\n                        target=\"_blank\">Bioinformatics</a> from UNC Charlotte. The first year, I was the only employee at a nanotechnology\n                    start up of two people. Although the work was highly interesting, I soon traded in my pipettes and lab\n                    gloves to put 100% of my focus on programming.\n                </p>\n                <!--<hr class=\"content-divider small\">-->\n                <p class=\"home--home-paragraph\">\n                    I learned how to program in various languages during my education, and loved the constant problem solving and satisfaction\n                    that came with even little accomplishments. Although I loved the sciences and the field of bioinformatics,\n                    various reasons lead me to turn my focus to a broader view of the world of programming.\n                </p>\n                <!--<hr class=\"content-divider small\">-->\n                <p class=\"home--home-paragraph\">\n                    In early 2016, I taught myself web application development at home while finishing my final semester in school. Although\n                    programming did consume my life day and night for this period of my life (sorry, Lily, I love you!), I learned an\n                    incredible amount and found building tools and applications that other people could use incredibly\n                    exciting. Today, software engineering is my passion and I am a full stack software developer in Charlotte, North Carolina. I have an amazing and loving girlfriend (the aforementioned Lily), and the best\n                    cat in the world, Ella.\n                </p>\n                <hr class=\"content-divider small bottom\">\n            </div>\n        </div>\n    </div>\n</template>"; });
